package CollectionsFramework;

import java.util.ArrayList;

public class ArrayListEx {

	public static void main(String[] args) {
		// TODO Auto-generated method stub

		ArrayList<String> list = new ArrayList<>();
		list.add("Akshada");
		list.add("Shinde");

		for (String s : list) {
			System.out.println(s);
		}
	}

}
